function ProductCard({ product, addToCart }) {
  return (
    <div style={styles.card}>
      <img
        src={product.image}
        alt={product.name}
        style={styles.image}
      />

      <h3>{product.name}</h3>
      <p>{product.category}</p>
      <p>${product.price}</p>

      <div style={styles.actions}>
        <button onClick={() => addToCart(product)}>
          Add to cart
        </button>
        <button>â™¡ Favorite</button>
      </div>
    </div>
  );
}

const styles = {
  card: {
    border: '1px solid #333',
    borderRadius: '8px',
    padding: '16px',
    width: '200px',
  },
  image: {
    width: '100%',
    marginBottom: '8px',
  },
  actions: {
    display: 'flex',
    gap: '8px',
  },
};

export default ProductCard;
